<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Study App Onboarding</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, sans-serif;
            height: 100vh;
            overflow: hidden;
            background: white;
        }

        .container {
            height: 100vh;
            width: 100%;
            position: relative;
            display: flex;
            flex-direction: column;
            max-width: 400px;
            margin: 0 auto;
            background: white;
        }

        .onboarding-wrapper {
            position: relative;
            width: 100%;
            height: 100%;
            display: flex;
            flex-direction: column;
            transition: transform 0.6s cubic-bezier(0.25, 0.46, 0.45, 0.94);
        }

        .onboarding-page {
            width: 100%;
            height: 100%;
            display: none;
            flex-direction: column;
            background: white;
        }

        .onboarding-page.active {
            display: flex;
        }

        .progress-section {
            padding: 20px 15px 0;
            display: flex;
            gap: 10px;
            justify-content: center;
            z-index: 10;
            position: relative;
            background: linear-gradient(180deg, #C8F560 0%, #D4FF88 100%);
        }

        .progress-bar {
            height: 6px;
            background: rgba(255, 255, 255, 0.4);
            border-radius: 4px;
            flex: 1;
            transition: all 0.4s ease;
        }

        .progress-bar.active {
            background: rgba(0, 0, 0, 1);
            height: 6px;
        }

.hero-section {
    flex: 1;
    display: flex;
    align-items: center;
    justify-content: center;
    padding: 40px 20px 40px;
    position: relative;
    margin-top:-80px;
    background: linear-gradient(180deg, 
        #C8F560 0%,                           /* Neon pastel green */
        #D4FF88 30%,                          /* Bright pastel */
        rgba(212, 255, 136, 0.9) 50%,         /* Smooth soft transition */
        rgba(212, 255, 136, 0.9) 70%,         /* Blending into light minty fog */
        rgba(255, 255, 255, 0.5) 85%,         /* Transparent white */
        rgba(255, 255, 255, 0.9) 95%,         /* Foggy white */
        rgba(255, 255, 255, 1) 100%           /* Solid white bottom */
    );
}
        .illustration {
          position: absolute;
            width: 200px;
            height: 200px;
            top: -60px;
            opacity: 0.9;
            transform: translateY(50px);
            animation: slideUpFade 1s ease-out 0.3s forwards;
        }

        .content-section {
            background: white;
            border-radius: 0;
            padding: 100px 30px 50px;
            display: flex;
            flex-direction: column;
            align-items: center;
            text-align: center;
            position: relative;
            min-height: 35vh;
            width: 100%;
        }

        .logo-container {
            position: absolute;
            top: -150px;
            left: 50%;
            transform: translateX(-50%) rotate(45deg);
            width: 100px;
            height: 100px;
            background: #000;
            border-radius: 15px;
            display: flex;
            align-items: center;
            justify-content: center;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.15);
            opacity: 0;
            animation: slideUpFadeStay 1s ease-out 0.6s forwards;
        }

        .logo-container img {
            width: 79px;
            height: 79px;
            object-fit: contain;
            transform: rotate(-45deg);
        }

        .main-text {
          position: absolute;
            font-size: 40px;
            font-weight: 900;
            color: #000;
            top: -30px;
            line-height: 1.3;
            max-width: 350px;
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
            letter-spacing: -0.5px;
            transform: translateY(30px);
            opacity: 0;
            animation: slideUpFade 1s ease-out 0.9s forwards;
        }

        .continue-btn {
          position: relative;
            background: #000;
            margin-top:40px ;
            color: white;
            border: none;
            padding: 22px 50px;
            border-radius: 25px;
            font-size: 18px;
            font-weight: 800;
            cursor: pointer;
            display: flex;
            align-items: center;
            gap: 5px;
            box-shadow: 0 6px 20px rgba(0, 0, 0, 0.2);
            transition: all 0.3s ease;
            width: 100%;
            max-width: 340px;
            justify-content: center;
            transform: translateY(30px);
            opacity: 0;
            animation: slideUpFade 1s ease-out 1.2s forwards;
        }

        .continue-btn:hover {
            transform: translateY(-2px);
            box-shadow: 0 8px 25px rgba(0, 0, 0, 0.3);
        }

        .continue-btn:active {
            transform: translateY(0);
        }

        .arrow {
            width: 18px;
            height: 18px;
            fill: currentColor;
            transition: transform 0.3s ease;
        }

        .continue-btn:hover .arrow {
            transform: translateX(3px);
        }

        @keyframes slideUpFade {
            from {
                opacity: 0;
                transform: translateY(30px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        @keyframes slideUpFadeStay {
            from {
                opacity: 0;
                transform: translateX(-50%) rotate(45deg) translateY(30px);
            }
            to {
                opacity: 1;
                transform: translateX(-50%) rotate(45deg) translateY(0);
            }
        }

        @keyframes slideInFromRight {
            from {
                opacity: 0;
                transform: translateX(50px);
            }
            to {
                opacity: 1;
                transform: translateX(0);
            }
        }

        .page-transition {
            animation: slideInFromRight 0.6s ease-out;
        }
        
                .mode-toggle {
            text-align: center;
            margin: 20px 0;
        }
        .mode-toggle-text {
            font-size: 14px;
            color: #666;
        }
        .mode-toggle-link {
            color: #000;
            font-weight: 600;
            text-decoration: none;
            cursor: pointer;
            transition: color 0.3s ease;
        }
        .mode-toggle-link:hover {
            color: #333;
            text-decoration: underline;
        }

        /* Responsive Design */
        @media (max-width: 480px) {
            .container {
                max-width: 100%;
            }
            
            .progress-section {
                padding: 15px 10px 0;
                gap: 8px;
            }
            
            .hero-section {
                padding: 30px 15px 30px;
            }
            
            .illustration {
              margin-top:-90px;
                width: 180px;
                height: 180px;
            }
            
            .content-section {
                padding: 80px 20px 40px;
                min-height: 300px;
            }
            
            .main-text {
                font-size: 34px;
                top:-40px;
                max-width: 300px;
            }
            
            .continue-btn {
                padding: 20px 45px;
                font-size: 17px;
                max-width: 300px;
                margin-top: 15px;
            }

            .logo-container {
                width: 83px;
                height: 83px;
                top: -140px;
                border-radius: 12px;
            }

            .logo-container img {
                width: 90px;
                height: 90px;
            }
        }

        @media (min-width: 481px) and (max-width: 768px) {
            .container {
                max-width: 450px;
            }
            
            .progress-section {
                padding: 18px 12px 0;
            }
        }

        @media (min-width: 769px) {
            .container {
                max-width: 400px;
                box-shadow: 0 0 30px rgba(0, 0, 0, 0.1);
                border-radius: 30px;
                overflow: hidden;
                margin-top: 20px;
                height: calc(100vh - 40px);
            }
            
            body {
                background: #f5f5f5;
                display: flex;
                align-items: center;
                justify-content: center;
            }
        }

        .loading-overlay {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: linear-gradient(180deg, #CCFF99 0%, #B8FF99 50%, white 100%);
            z-index: 1000;
            display: flex;
            align-items: center;
            justify-content: center;
            transition: opacity 0.5s ease, visibility 0.5s ease;
        }

        .loading-overlay.hidden {
            opacity: 0;
            visibility: hidden;
        }

        .loading-spinner {
            width: 40px;
            height: 40px;
            border: 3px solid rgba(255, 255, 255, 0.3);
            border-top: 3px solid white;
            border-radius: 50%;
            animation: spin 1s linear infinite;
        }

        @keyframes spin {
            0% { transform: rotate(0deg); }
            100% { transform: rotate(360deg); }
        }
                .modal-overlay {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0, 0, 0, 0.5);
            backdrop-filter: blur(4px);
            z-index: 2000;
            display: flex;
            align-items: flex-end;
            justify-content: center;
            opacity: 0;
            visibility: hidden;
            transition: all 0.3s ease;
        }

        .modal-overlay.active {
            opacity: 1;
            visibility: visible;
        }

        .modal-content {
            background: white;
            border-radius: 20px 20px 0 0;
            width: 100%;
            max-width: 400px;
            padding: 24px;
            transform: translateY(100%);
            transition: transform 0.4s cubic-bezier(0.25, 0.46, 0.45, 0.94);
        }

        .modal-overlay.active .modal-content {
            transform: translateY(0);
        }

        .modal-header {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 24px;
        }

        .modal-logo {
            width: 32px;
            height: 32px;
            background: #000;
            border-radius: 6px;
            display: flex;
            align-items: center;
            justify-content: center;
            transform: rotate(45deg);
        }

        .modal-logo img {
            width: 30px;
            height: 30px;
            transform: rotate(-45deg);
        }

        .modal-close {
            background: none;
            border: none;
            cursor: pointer;
            padding: 4px;
            color: #666;
            transition: color 0.2s ease;
        }

        .modal-close:hover {
            color: #000;
        }

        .modal-body {
            text-align: center;
        }

        .modal-title {
            font-size: 24px;
            font-weight: 900;
            color: #000;
            margin-bottom: 12px;
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
        }

        .modal-subtitle {
            font-size: 14px;
            color: #666;
            line-height: 1.4;
            margin-bottom: 32px;
            max-width: 280px;
            margin-left: auto;
            margin-right: auto;
        }

                .email-btn {
            background: #000;
            color: white;
            border: none;
            padding: 16px 24px;
            border-radius: 12px;
            font-size: 16px;
            font-weight: 600;
            cursor: pointer;
            width: 100%;
            margin-bottom: 20px;
            transition: all 0.2s ease;
            text-decoration: none;
            display: block;
            text-align: center;
        }

        .email-btn:hover {
            background: #333;
            transform: translateY(-1px);
        }

        .social-buttons {
            display: flex;
            gap: 12px;
        }

        .social-btn {
            flex: 1;
            background: #f8f9fa;
            border: 1px solid #e9ecef;
            border-radius: 12px;
            padding: 16px;
            cursor: pointer;
            display: flex;
            align-items: center;
            justify-content: center;
            transition: all 0.2s ease;
        }

        .social-btn:hover {
            background: #e9ecef;
            transform: translateY(-1px);
        }

        .social-btn:disabled {
            opacity: 0.6;
            cursor: not-allowed;
            transform: none;
        }

        .apple-btn {
            color: #000;
        }

        .google-btn {
            color: #4285f4;
        }

        @media (max-width: 480px) {
            .modal-content {
                padding: 20px;
                border-radius: 16px 16px 0 0;
            }
            
            .modal-title {
                font-size: 22px;
            }
            
            .modal-subtitle {
                font-size: 13px;
                margin-bottom: 28px;
            }
        }
    </style>
</head>
<body>
    <div class="loading-overlay" id="loadingOverlay">
        <div class="loading-spinner"></div>
    </div>

    <div class="container">
        <div class="onboarding-wrapper" id="onboardingWrapper">
            <!-- Page 1 -->
            <div class="onboarding-page active">
                <div class="progress-section">
                    <div class="progress-bar active"></div>
                    <div class="progress-bar"></div>
                    <div class="progress-bar"></div>
                </div>

                <div class="hero-section">

        <script src="https://accounts.google.com/gsi/client" async defer></script>

    <script>
        // Configuration
        const API_BASE_URL = 'https://my-easy-school-api.onrender.com';
        const GOOGLE_CLIENT_ID = '851891985017-srsbdslk2l41pbcq9ao9q015v3tqiu4e.apps.googleusercontent.com';

        // Global variables
        let currentPage = 0;
        const totalPages = 3;
        let currentUser = null;

        // Initialize app
        window.addEventListener('load', function() {
            setTimeout(() => {
                document.getElementById('loadingOverlay').classList.add('hidden');
                checkAuthStatus();
                initializeGoogleSignIn();
            }, 1000);
        });

        // Initialize Google Sign-In
        function initializeGoogleSignIn() {
            if (typeof google !== 'undefined') {
                google.accounts.id.initialize({
                    client_id: GOOGLE_CLIENT_ID,
                    callback: handleGoogleSignIn,
                    auto_select: false,
                    cancel_on_tap_outside: false
                });
            }
        }

        // Handle Google Sign-In response
        async function handleGoogleSignIn(response) {
            try {
                console.log('Google credential received:', response.credential);
                
                const result = await fetch(`${API_BASE_URL}/api/auth/google`, {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    body: JSON.stringify({
                        credential: response.credential
                    })
                });

                console.log('Backend response status:', result.status);
                const data = await result.json();
                console.log('Backend response data:', data);

                if (result.ok) {
                    if (data.token) {
                        localStorage.setItem('authToken', data.token);
                        currentUser = data.user;
                        closeModal();
                        window.location.href = 'dashboard.html';
                    } else {
                        throw new Error('No token received from server');
                    }
                } else {
                    throw new Error(data.message || 'Google authentication failed');
                }
            } catch (error) {
                console.error('Google auth error:', error);
                alert(`Google authentication failed: ${error.message}`);
            }
        }

        // Check if user is already authenticated
        async function checkAuthStatus() {
            try {
                const token = localStorage.getItem('authToken');
                if (token) {
                    // Verify token with backend
                    const response = await fetch(`${API_BASE_URL}/api/auth/login`, {
                        method: 'POST',
                        headers: {
                            'Content-Type': 'application/json',
                            'Authorization': `Bearer ${token}`
                        },
                        body: JSON.stringify({ action: 'verify' })
                    });

                    if (response.ok) {
                        const userData = await response.json();
                        currentUser = userData;
                        // Redirect to dashboard.html
                        window.location.href = 'dashboard.html';
                        return;
                    } else {
                        localStorage.removeItem('authToken');
                    }
                }
            } catch (error) {
                console.error('Auth check failed:', error);
                localStorage.removeItem('authToken');
            }
            
            updatePage();
        }

        // Onboarding navigation
        function nextPage() {
            if (currentPage < totalPages - 1) {
                currentPage++;
                updatePage();
            }
        }

        function getStarted() {
            const btn = document.querySelector('.continue-btn');
            btn.style.transform = 'scale(0.95)';
            
            setTimeout(() => {
                btn.style.transform = '';
                showModal();
            }, 150);
        }

        function updatePage() {
            const pages = document.querySelectorAll('.onboarding-page');
            
            pages.forEach(page => page.classList.remove('active'));
            pages[currentPage].classList.add('active');
            
            const currentPageElement = pages[currentPage];
            const progressBars = currentPageElement.querySelectorAll('.progress-bar');
            progressBars.forEach((bar, index) => {
                if (index <= currentPage) {
                    bar.classList.add('active');
                } else {
                    bar.classList.remove('active');
                }
            });
            
            setTimeout(() => {
                const elements = currentPageElement.querySelectorAll('.illustration, .main-text, .continue-btn, .logo-container');
                
                elements.forEach((element, index) => {
                    element.style.animation = 'none';
                    element.offsetHeight;
                    if (element.classList.contains('logo-container')) {
                        element.style.animation = `slideUpFadeStay 0.8s ease-out ${index * 0.1}s forwards`;
                    } else {
                        element.style.animation = `slideUpFade 0.8s ease-out ${index * 0.1}s forwards`;
                    }
                });
            }, 100);
        }

        // Modal functions
        function showModal() {
            const modalOverlay = document.getElementById('modalOverlay');
            modalOverlay.classList.add('active');
            document.body.style.overflow = 'hidden';
        }

        function closeModal() {
            const modalOverlay = document.getElementById('modalOverlay');
            modalOverlay.classList.remove('active');
            document.body.style.overflow = '';
        }

        // Authentication functions
        function continueWithApple() {
            alert('Apple Sign-In not implemented yet');
        }

        async function continueWithGoogle() {
            const googleBtn = document.getElementById('googleBtn');
            const originalContent = googleBtn.innerHTML;
            
            // Show loading state
            googleBtn.disabled = true;
            googleBtn.innerHTML = '<div style="width: 20px; height: 20px; border: 2px solid #f3f3f3; border-top: 2px solid #4285f4; border-radius: 50%; animation: spin 1s linear infinite;"></div>';

            try {
                if (typeof google !== 'undefined') {
                    console.log('Triggering Google Sign-In...');
                    // Use Google Sign-In popup
                    google.accounts.id.prompt((notification) => {
                        console.log('Google prompt notification:', notification);
                        if (notification.isNotDisplayed() || notification.isSkippedMoment()) {
                            console.log('Google prompt not displayed, trying alternative method...');
                            // Alternative: Try to render the button and click it programmatically
                            const tempDiv = document.createElement('div');
                            tempDiv.style.display = 'none';
                            document.body.appendChild(tempDiv);
                            
                            google.accounts.id.renderButton(tempDiv, {
                                theme: 'outline',
                                size: 'large'
                            });
                            
                            // Simulate click on the hidden button
                            setTimeout(() => {
                                const hiddenBtn = tempDiv.querySelector('div[role="button"]');
                                if (hiddenBtn) {
                                    hiddenBtn.click();
                                } else {
                                    alert('Google Sign-In is not available. Please try again later.');
                                }
                                document.body.removeChild(tempDiv);
                            }, 100);
                        }
                        // Reset button state
                        googleBtn.disabled = false;
                        googleBtn.innerHTML = originalContent;
                    });
                } else {
                    throw new Error('Google Sign-In SDK not loaded');
                }
            } catch (error) {
                console.error('Google auth error:', error);
                alert(`Google authentication failed: ${error.message}`);
                
                // Reset button state
                googleBtn.disabled = false;
                googleBtn.innerHTML = originalContent;
            }
        }

        // Handle OAuth callback from URL parameters
        function handleOAuthCallback() {
            const urlParams = new URLSearchParams(window.location.search);
            const token = urlParams.get('token');
            const error = urlParams.get('error');

            if (error) {
                alert('Authentication failed. Please try again.');
                // Clean up URL
                window.history.replaceState({}, document.title, window.location.pathname);
                return;
            }

            if (token) {
                localStorage.setItem('authToken', token);
                // Clean up URL and redirect to dashboard
                window.history.replaceState({}, document.title, window.location.pathname);
                window.location.href = 'dashboard.html';
            }
        }

        // Check for OAuth callback on page load
        if (window.location.search.includes('token=') || window.location.search.includes('error=')) {
            handleOAuthCallback();
        }

        // Event listeners
        document.addEventListener('click', function(e) {
            const modalOverlay = document.getElementById('modalOverlay');
            if (e.target === modalOverlay) {
                closeModal();
            }

            if (e.target.classList.contains('continue-btn') || e.target.closest('.continue-btn')) {
                const btn = e.target.classList.contains('continue-btn') ? e.target : e.target.closest('.continue-btn');
                btn.style.transform = 'scale(0.95)';
                setTimeout(() => {
                    btn.style.transform = '';
                }, 150);
            }
        });

        // Keyboard navigation
        document.addEventListener('keydown', function(e) {
            if (e.key === 'ArrowRight' && currentPage < totalPages - 1) {
                nextPage();
            } else if (e.key === 'Enter' || e.key === ' ') {
                if (currentPage < totalPages - 1) {
                    nextPage();
                } else {
                    getStarted();
                }
            }
        });

        // Function to set the email link URL (you can call this to update the link)
        function setEmailLink(url) {
            document.getElementById('emailLink').href = url;
        }
    </script>
